Hi @sumitsays 
Thank you for checking! In that case I am probably unintentionally violating some assumption.


Here is a minimal example that produces this error message for me:

```
#include <cassert>
#include <cstdlib>
#include <iostream>
#include <limits>

#include <dml_provider_factory.h>
#include <onnxruntime_c_api.h>
#include <onnxruntime_cxx_api.h>

int main()
{
    OrtThreadingOptions* threading_options{nullptr};
    Ort::ThrowOnError(Ort::GetApi().CreateThreadingOptions(&threading_options));
    Ort::ThrowOnError(Ort::GetApi().SetGlobalIntraOpNumThreads(threading_options, 1));
    Ort::ThrowOnError(Ort::GetApi().SetGlobalInterOpNumThreads(threading_options, 1));
    assert(threading_options != nullptr);
    Ort::Env env(threading_options, ORT_LOGGING_LEVEL_VERBOSE, "test");

    Ort::SessionOptions session_options;
    session_options.DisablePerSessionThreads();
    session_options.SetExecutionMode(ORT_SEQUENTIAL);

    //session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_EXTENDED);
    session_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_DISABLE_ALL);
    //Disable the next line to run on cpu:
    Ort::ThrowOnError(OrtSessionOptionsAppendExecutionProvider_DML(session_options, 0));
    const wchar_t* model_path = L"data/gpt2/gpt2-lm-head-10.onnx";

    {
        Ort::Session session(env, model_path, session_options);

        Ort::AllocatorWithDefaultOptions allocator;

        const char* input_name = "input1";
        std::vector<int64_t> input_tensor_values{3792, 428, 262, 1103, 1517, 393, 318, 428, 655};

        int64_t input_tensor_size = input_tensor_values.size();
        std::vector<int64_t> input_node_dims{1, 1, input_tensor_size};

        const char* output_name = "output1";

        // create input tensor object from data values
        auto memory_info = Ort::MemoryInfo::CreateCpu(OrtArenaAllocator, OrtMemTypeDefault);
        Ort::Value input_tensor =
            Ort::Value::CreateTensor<int64_t>(memory_info, input_tensor_values.data(),
                input_tensor_size, input_node_dims.data(), input_node_dims.size());
        assert(input_tensor.IsTensor());

        // score model & input tensor, get back output tensor
        Ort::RunOptions ropts;
        ropts.SetRunLogVerbosityLevel(ORT_LOGGING_LEVEL_VERBOSE);

        auto output_tensors = session.Run(ropts, &input_name, &input_tensor, 1, &output_name, 1);

        assert(output_tensors.size() == 1 && output_tensors.front().IsTensor());

        Ort::TensorTypeAndShapeInfo shape = output_tensors.front().GetTensorTypeAndShapeInfo();
        std::vector<int64_t> result_shape = shape.GetShape();
        for (int64_t v : result_shape) {
            std::cout << "Result shape: " << v << std::endl;
        }
        float* float_ptr = output_tensors.front().GetTensorMutableData<float>();

        float maxv = std::numeric_limits<float>::lowest();
        int max_idx = -1;
        const int64_t vocab_size = 50257;
        for (int i = 0; i < 50257; ++i) {
            const float v = float_ptr[(input_tensor_size - 1) * vocab_size + i];
            if (v > maxv) {
                maxv = v;
                max_idx = i;
            }
        }
        std::cout << "Best: " << max_idx << " V: " << maxv << std::endl;
    }
    Ort::GetApi().ReleaseThreadingOptions(threading_options);
    std::cout << "Done." << std::endl;
    return 0;
}
```
If I do not register the dml provider, the example runs fine.
Maybe there is something obvious I am missing for the dml provider.
